import React, { useState, useEffect } from "react";

interface Labor {
    id?: string;
    name: string;
    skills: string;
    mobile: string;
    address: string;
    city: string;
}

const Home: React.FC = () => {
    const [laborList, setLaborList] = useState<Labor[]>([]);
    const [searchQuery, setSearchQuery] = useState("");

    // Fetch labors from backend
    useEffect(() => {
        const fetchLabors = async () => {
            try {
                const response = await fetch("http://localhost:5000/api/labors"); // Adjust the URL if necessary
                if (response.ok) {
                    const data = await response.json();
                    setLaborList(data);
                } else {
                    console.error("Failed to fetch labors:", response.statusText);
                }
            } catch (error) {
                console.error("Error fetching labors:", error);
            }
        };

        fetchLabors();
    }, []);

    const handleLaborRegister = async (event: React.FormEvent<HTMLFormElement>) => {
        event.preventDefault();

        const formData = new FormData(event.currentTarget);
        const newLabor = {
            name: formData.get("name") as string,
            skills: formData.get("skills") as string,
            mobile: formData.get("mobile") as string,
            address: formData.get("address") as string,
            city: formData.get("city") as string,
        };

        try {
            const response = await fetch("http://localhost:5000/api/labors", {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(newLabor),
            });

            if (response.ok) {
                const savedLabor = await response.json();
                setLaborList((prev) => [...prev, savedLabor]); // Update the labor list with the new entry
            }
        } catch (error) {
            console.error("Failed to add labor:", error);
        }
    };

    return (
        <div className="container mx-auto p-4">
            <div className="flex flex-col lg:flex-row justify-between gap-8">
                {/* Search Section */}
                <div className="w-full lg:w-1/2 border p-4 rounded shadow">
                    <h2 className="text-xl font-bold mb-4">Search for Labor</h2>
                    <input
                        type="text"
                        placeholder="Search by skill or city"
                        className="w-full border rounded p-2 mb-4"
                        value={searchQuery}
                        onChange={(e) => setSearchQuery(e.target.value)}
                    />
                    <div
                        className="h-64 overflow-y-auto border-t pt-2"
                        style={{ maxHeight: "200px" }}
                    >
                        {laborList
                            .filter(
                                (labor) =>
                                    labor.skills.toLowerCase().includes(searchQuery.toLowerCase()) ||
                                    labor.city.toLowerCase().includes(searchQuery.toLowerCase())
                            )
                            .map((labor) => (
                                <div
                                    key={labor.id}
                                    className="p-2 border-b last:border-none text-sm"
                                >
                                    <p>
                                        <strong>{labor.name}</strong> - {labor.skills}
                                    </p>
                                    <p>{labor.city}</p>
                                    <p>{labor.mobile}</p>
                                </div>
                            ))}
                    </div>
                </div>

                {/* Register Section */}
                <div className="w-full lg:w-1/2 border p-4 rounded shadow">
                    <h2 className="text-xl font-bold mb-4">Labor Registration</h2>
                    <form onSubmit={handleLaborRegister}>
                        <input
                            type="text"
                            name="name"
                            placeholder="Name"
                            className="w-full border rounded p-2 mb-2"
                            required
                        />
                        <input
                            type="text"
                            name="skills"
                            placeholder="Skills"
                            className="w-full border rounded p-2 mb-2"
                            required
                        />
                        <input
                            type="text"
                            name="mobile"
                            placeholder="Mobile"
                            className="w-full border rounded p-2 mb-2"
                            required
                        />
                        <input
                            type="text"
                            name="address"
                            placeholder="Address"
                            className="w-full border rounded p-2 mb-2"
                            required
                        />
                        <input
                            type="text"
                            name="city"
                            placeholder="City"
                            className="w-full border rounded p-2 mb-2"
                            required
                        />
                        <button
                            type="submit"
                            className="bg-blue-500 text-white p-2 rounded w-full hover:bg-blue-600"
                        >
                            Register
                        </button>
                    </form>
                </div>
            </div>
        </div>
    );
};

export default Home;
